import React, { useState, useEffect, useContext } from "react";
import $ from "jquery";
import { confirmAlert } from 'react-confirm-alert';
import ShareLink from 'react-facebook-share-link';
import TwitterLink from 'react-twitter-share-link'
import Snackbar from '@material-ui/core/Snackbar';
import Skeleton from '@material-ui/lab/Skeleton';
import MuiAlert from '@material-ui/lab/Alert';
import Backdrop from '@material-ui/core/Backdrop';
import CircularProgress from '@material-ui/core/CircularProgress';
import banner from "../../../images/vtc-banner.jpg";
import profile from "../../../images/profile.jpg";
import Switch from "react-switch";
import Footer from "../../../components/Footer/AgentFooter";
import AgentHeader from "../Header/AgentHeader";
import { Link, useHistory } from "react-router-dom";
import { AuthContext } from "../../../CommonMethods/Authentication";
import { APIURL, APIPath } from "../../../CommonMethods/Fetch";
import { postRecord } from "../../../CommonMethods/Save";
import ReactPaginate from 'react-paginate';
import { makeStyles } from '@material-ui/core/styles';
import { event } from "jquery";
const APIGetUserData = APIURL() + "user-details";
const APIGetImagesetList = APIURL() + "get-imagesetlist";
const APIChangeService = APIURL() + "change-tour-service";
const APIChangeStatus = APIURL() + "change-status";
const APIDeleteImageset = APIURL() + "delete-imageset";
const APIActivate = APIURL() + "change-image-status";
const APISaveToDeskTop = APIURL() + "savetodesktop";
const APIGetStates = APIURL() + "get-states";
const APIGetCategory = APIURL() + "get-categories";
const APIGetPropertyType = APIURL() + "get-Propertytype";
const APIGetTourDetails = APIURL() + "tour-details";
function Alert(props) {
    return <MuiAlert elevation={6} variant="filled" {...props} />;
}
const useStyles = makeStyles((theme) => ({
    backdrop: {
        zIndex: theme.zIndex.drawer + 9999,
        color: '#fff',
    },
}));
export default function AgentTourList(props) {
    let history = useHistory();
    const classes = useStyles();
    const { dispatch } = useContext(AuthContext);
    const context = useContext(AuthContext);
    const [currentUser, setCurrentUser] = useState({});
    const [imagesetList, setImagesetList] = useState([]);
    const [sync, setSync] = useState(true);
    const [id, setId] = useState("");
    const [openError, setOpenError] = useState(false);
    const [openSuccess, setOpenSuccess] = useState(false);
    const [message, setMessage] = useState("");
    const [element, setElement] = useState("");
    const [propertyData, setPropertyData] = useState({});
    const [allStates, setAllStates] = useState([]);
    const [categoryInfo, setCategoryInfo] = useState({});
    const [categoryData, setCategoryData] = useState([]);
    const [orderByData, setOrderByData] = useState({});
    const [propertyType, setPropertyType] = useState([]);
    const [propertyDataType, setPropertyTypeData] = useState({});
    const [offset, setOffset] = useState(0);
    const [postPerPage] = useState(6);
    const [pageCount, setPageCount] = useState(0);
    const [allData, setAllData] = useState([]);
    const [totalData, setTotalData] = useState([]);
    const [same, setSame] = useState(false);
    const [themeId, setThemeId] = useState("");
    const [defaultsThemeId, setDefaultsThemeId] = useState("");
    const [isPremium, setIsPremium] = useState("");
    const [refresh, setRefresh] = useState(true);
    const [open, setOpen] = useState(false);
    useEffect(() => {
        if (context.state.user) {
            //  console.log(JSON.parse(context.state.user).agentId);
            const objusr = { authenticate_key: "abcd123XYZ", agent_id: JSON.parse(context.state.user).agentId };
            postRecord(APIGetUserData, objusr)
                .then(res => {
                    if (res.data[0].response.status === "success") {
                        setCurrentUser(res.data[0].response.data.agent_profile);
                    }
                });
        }
    }, [context.state.user]);

    useEffect(() => {
        if (context.state.user) {
            const objusr = { authenticate_key: "abcd123XYZ", agent_id: JSON.parse(context.state.user).agentId };
            postRecord(APIGetImagesetList, objusr)
                .then(res => {
                    if (res.data[0].response.status === "success") {
                        setImagesetList(res.data[0].response.data);
                        setOrderByData(res.data[0].response.orderby);
                    }
                });
        }
    }, [context.state.user, sync]);

    useEffect(() => {
        const objusr = { authenticate_key: "abcd123XYZ", country_id: 40 };
        postRecord(APIGetStates, objusr)
            .then(res => {
                // console.log(res);
                if (res.data[0].response.status === "success") {
                    setAllStates(res.data[0].response.data);
                }
            });
    }, [propertyData.countryid]);
    useEffect(() => {
        const objusr = { authenticate_key: "abcd123XYZ" };
        postRecord(APIGetCategory, objusr)
            .then(res => {
                // console.log(res);
                if (res.data[0].response.status === "success") {
                    setCategoryData(res.data[0].response.data);
                }
            });
    }, []);
    useEffect(() => {
        const objusr = { authenticate_key: "abcd123XYZ" };
        postRecord(APIGetPropertyType, objusr)
            .then(res => {
                if (res.data[0].response.status === "success") {
                    setPropertyType(res.data[0].response.data);
                }
            });
    }, []);
    //console.log(id);
    useEffect(() => {
        if (context.state.user) {
            const agent_id = JSON.parse(context.state.user).agentId;
            if (themeId === 1 && isPremium === 1) {
                window.open("https://virtualtourcafe.com/alpha/tour/theme-template/" + id + "/" + agent_id, '_blank');
                setThemeId("");
            } else if (themeId === 2 && isPremium === 1) {
                window.open("https://virtualtourcafe.com/alpha/tour/theme-template1/" + id + "/" + agent_id, '_blank');
                setThemeId("");
            } else if (themeId === 3 && isPremium === 1) {
                window.open("https://virtualtourcafe.com/alpha/tour/theme-template2/" + id + "/" + agent_id, '_blank');
                setThemeId("");
            } else if (themeId === 4 && isPremium === 1) {
                window.open("https://virtualtourcafe.com/alpha/tour/theme-template3/" + id + "/" + agent_id, '_blank');
                setThemeId("");
            }
            else if (themeId === 5) {
                window.open("https://virtualtourcafe.com/alpha/tour/theme-template4/" + id + "/" + agent_id, '_blank');
                setThemeId("");
            }
        }
    }, [themeId, context.state.user, id, isPremium])
    useEffect(() => {
        if (context.state.user) {
            const agent_id = JSON.parse(context.state.user).agentId;
            if (defaultsThemeId && isPremium === 0) {
                // window.location.href = "http://localhost:3001/theme-template5/" + id + APIPath() + agent_id + APIPath() + defaultsThemeId;
                // window.location.href = "https://virtualtourcafe.com/alpha/tour/theme-template5/" + id + "/" + agent_id;
                window.open("https://virtualtourcafe.com/alpha/tour/theme-template5/" + id + "/" + agent_id + "/" + defaultsThemeId, '_blank');
                setDefaultsThemeId("");
            }
        }
    }, [context.state.user, id, isPremium, defaultsThemeId])
    useEffect(() => {
        if (imagesetList.length > 0) {
            filterData();
        }
        else {
            setAllData([]);
        }
    }, [offset, imagesetList]);
    useEffect(() => {
        setTimeout(() => {
            setRefresh(false);
        }, 2000)
    }, [allData])
    useEffect(() => {
        $(".gee_cross").hide();
        $(".gee_menu").hide();
    }, []);
    const ShowMenu = () => {
        $(".gee_menu").slideToggle("slow", function () {
            $(".gee_hamburger").hide();
            $(".gee_cross").show();
        });
    }
    const HideMenu = () => {
        $(".gee_menu").slideToggle("slow", function () {
            $(".gee_cross").hide();
            $(".gee_hamburger").show();
        });
    }
    const filterData = async () => {
        const endOffset = offset + postPerPage;
        setTotalData(imagesetList.slice(offset, endOffset));
        setAllData(imagesetList.slice(offset, endOffset));
        setPageCount(Math.ceil(imagesetList.length / postPerPage));
    }
    const handleClose = (event, reason) => {
        if (reason === 'clickaway') {
            return;
        }
        setOpenError(false);
        setOpenSuccess(false);
    };
    const handleImageSetId = (data) => {
        var div = document.getElementById("myDiv" + data.id);
        if (element !== "") {
            element.classList.remove("active");
        }
        if (element === div) {
            div.classList.remove("active");
            setElement("");
            setId("");
        }
        else {
            div.classList.add("active");
            setElement("");
            setElement(div);
            setId(data.id);
        }
    }
    const handleTourServiceChange = (event, tid) => {
        //var check = data.virtualtourservice === 1 ? 0 : 1;
        const obj = {
            authenticate_key: "abcd123XYZ",
            agent_id: JSON.parse(context.state.user).agentId,
            status: "tour", virtualtourservice: event, tourid: tid
        };
        // console.log(obj);
        postRecord(APIChangeService, obj)
            .then(res => {
                if (res.data[0].response.status === "success") {
                    setMessage(res.data[0].response.message);
                    setOpenSuccess(true);
                    setSync(false);
                }
                else {
                    setMessage(res.data[0].response.message);
                    setOpenError(true);
                    setSync(false);
                }
                setSync(true);
            }).catch(err => {
                setMessage("Something Went Wrong. Please try again later...");
                setOpenError(true);
                setOpen(false);
            });
    }
    const handleFlyerServiceChange = (event, tid) => {
        const obj = { authenticate_key: "abcd123XYZ", agent_id: JSON.parse(context.state.user).agentId, tourid: tid, status: "flyer", flyerservice: event };
        postRecord(APIChangeService, obj)
            .then(res => {
                if (res.data[0].response.status === "success") {
                    setMessage(res.data[0].response.message);
                    setOpenSuccess(true);
                    setSync(false);
                }
                else {
                    setMessage(res.data[0].response.message);
                    setOpenError(true);
                    setSync(false);
                }
                setSync(true);
            }).catch(err => {
                setMessage("Something Went Wrong. Please try again later...");
                setOpenError(true);
                setOpen(false);
            });
    }
    const handleVideoServiceChange = (event, tid) => {
        //var check = data.videoservice === 1 ? 0 : 1;
        const obj = { authenticate_key: "abcd123XYZ", agent_id: JSON.parse(context.state.user).agentId, tourid: tid, status: "video", videoservice: event };
        //console.log(obj);
        postRecord(APIChangeService, obj)
            .then(res => {
                if (res.data[0].response.status === "success") {
                    setMessage(res.data[0].response.message);
                    setOpenSuccess(true);
                    setSync(false);
                }
                else {
                    setMessage(res.data[0].response.message);
                    setOpenError(true);
                    setSync(false);
                }
                setSync(true);
            }).catch(err => {
                setMessage("Something Went Wrong. Please try again later...");
                setOpenError(true);
                setOpen(false);
            });
    }
    const handleEditImageset = (data) => {
        history.push(APIPath() + "agent-edit-tour/" + data.id);
    }
    const handleDelete = (id) => {
        confirmAlert({
            message: 'Are you sure you want to delete this imageset ? ',
            buttons: [
                {
                    label: 'Yes',
                    onClick: () => {
                        const obj = { authenticate_key: "abcd123XYZ", agent_id: JSON.parse(context.state.user).agentId, tourId: id };
                        postRecord(APIDeleteImageset, obj)
                            .then(res => {
                                //console.log(res);
                                if (res.data[0].response.status === "success") {
                                    setMessage(res.data[0].response.message);
                                    setOpenSuccess(true);
                                    setSync(false);
                                }
                                else {
                                    setMessage(res.data[0].response.message);
                                    setOpenError(true);
                                    setSync(false);
                                }
                                setSync(true);
                            }).catch(err => {
                                setMessage("Something Went Wrong. Please try again later...");
                                setOpenError(true);
                                setOpen(false);
                            });
                    }
                },
                {
                    label: 'No',
                    onClick: () => {

                    }
                }
            ]
        });
    }
    const handleStatusChange = (event) => {
        let Tour = document.getElementById("statusId");

        const obj = { authenticate_key: "abcd123XYZ", agent_id: JSON.parse(context.state.user).agentId, tourid: Tour.value, opt: event.target.value };
        postRecord(APIChangeStatus, obj)
            .then(res => {
