                                                                        <div class="switchToggle custom-control custom-switch c1">
                                                                            <Switch
                                                                                onChange={(event) => handleVideoServiceChange(event, res.id)}
                                                                                checked={res.videoservice}
                                                                                handleDiameter={17}
                                                                                offColor="#5D5D5D"
                                                                                onColor="#F6AD17"
                                                                                offHandleColor="#fff"
                                                                                onHandleColor="#fff"
                                                                                height={25}
                                                                                width={45}
                                                                                borderRadius={6}
                                                                                uncheckedIcon={
                                                                                    <div
                                                                                        style={{
                                                                                            display: "flex",
                                                                                            justifyContent: "center",
                                                                                            alignItems: "center",
                                                                                            height: "100%",
                                                                                            fontSize: 13,
                                                                                            color: "white",
                                                                                            paddingRight: 2
                                                                                        }}
                                                                                    >
                                                                                        No
                                                                                    </div>
                                                                                }
                                                                                checkedIcon={
                                                                                    <div
                                                                                        style={{
                                                                                            display: "flex",
                                                                                            justifyContent: "center",
                                                                                            alignItems: "center",
                                                                                            height: "100%",
                                                                                            fontSize: 13,
                                                                                            color: "white",
                                                                                            paddingRight: 2
